        sumry_cn: "고급 생선회의 대명사로 통하는 참치회는 특유의 사르르 녹는 맛 때문에 많은 사람들에게 인기가 좋은 메뉴다. 그에 비해, 비슷한 맛과 식감을 내는 삼치회를 먹어본 사람은 그 비율이 극히 적다. 우리나라에서 삼치는 구이용 생선으로 더 잘 알려져 있기 때문인데, 사실 싱싱한 삼치회를 먹어본 사람이라면 왠만한 참치회는 저리 가라할 정도로 그 매력에 흠뻑 빠지게 된다. 참치와 삼치는 둘 다 고등어과에 속하며, 크기가 클수록 맛있다는 공통점이 있다. 그래서 삼치회 중에서도 으뜸은 전장 1미터가 넘어가는 대삼치다. 고울 려(麗), 물 수(水), 바다가 아름다운 도시에 가면 꼭 먹어봐야 할 생선회다.",
