        sumry_cn: "강릉을 대표하는 초당두부는 조선시대에 시작되었다. 삼척부사를 역임한 허엽 선생이 깨끗한 바닷물로 간을 맞추어 두부를 만들어 먹기 시작했고, \u2018초당(草堂)\u2019이라는 허엽의 호를 붙여 그 이름이 탄생했다. 일제강점기와 6·25전쟁을 겪으면서 초당 마을의 남자들은 줄어들고 여인들이 가족의 생계를 책임지기 위해 비용이 적게 드는 두부를 만들어 팔게 되었다. 관광객의 증가와 함께 1980년대부터 지금까지 강릉 초당동은 두부마을로 유명하다. 두부를 만들 때&nbsp;거품을 거둔 따듯한 콩물을 \u2018촛물\u2019이라고 하는데, 여기에 바닷물을 넣으면 촛물이 몽글몽글 뭉친다. 이것이 \u2018초두부\u2019로, 처음 만들어진 두부라는 뜻이다.&nbsp;",
